import  './FollowedMembersList.css'
const followedMembers = [
    {
      name: "John Doe",
      profilePicture: "https://example.com/profile-pics/john-doe.png",
      username: "@johndoe"
    },
    {
      name: "Jane Smith",
      profilePicture: "https://example.com/profile-pics/jane-smith.png",
      username: "@janesmith"
    },
    {
      name: "Bob Johnson",
      profilePicture: "https://example.com/profile-pics/bob-johnson.png",
      username: "@bobjohnson"
    }
  ];

  // Pass the array of followed members as a prop to the FollowedMembersList component
  function App() {
    return (
      <div>
        <FollowedMembersList members={followedMembers} />
      </div>
    );
  }

  // The FollowedMembersList component receives the array of followed members as a prop
  function FollowedMembersList(props) {
    const { members } = props;

    if (!members) {
      // Render loading indicator or other fallback content
      return <div>Loading...</div>;
    }

    return (
      <div>
        <h2>Followed Members:</h2>
        <ul>
          {members.map(member => (
            <li key={member.username}>
              <Member name={member.name} profilePicture={member.profilePicture} username={member.username} />
            </li>
          ))}
        </ul>
      </div>
    );
  }

  // The Member component receives the member's information as props
  function Member(props) {
    const { name, profilePicture, username } = props;

    return (
      <div>
        <img src={profilePicture} alt={`${name}'s profile picture`} />
        <h3>{name}</h3>
        <p>{username}</p>
      </div>
    );
  }

  export default FollowedMembersList
